import React from "react";

function App() {
    let [tabs, setTabs] = React.useState([])
    let [buttons, setButtons] = React.useState([])

    function buttonsList(props) {
        let buttons = ['Тайланд', 'Вьетнам', 'ОАЭ', 'Китай', 'Испания', 'Франция']
        return (
            buttons.map((buttonTitle) => {
                return (<button className='button' onClick={() => console.log(buttonTitle)}>{buttonTitle}</button>)
            }))
    }

    function cardList(props) {
        let tabs = ['Паттайя Север, 2 пляжная линия', 'Паттайя Север, 2 пляжная линия', 'Паттайя Центр', 'Паттайя Юг, 2 пляжная линия', ' Паттайя Юг, 2 пляжная линия', 'Паттайя Север, 2 пляжная линия']
        return (
            tabs.map((tab) => {
                return (
                    <span>{tab}</span>
                )
            })
        )
    }

    return (
        <div className='content'>
            <h2 className='header'>Горящие туры</h2>
            <p className='description'>Безусловно, сплоченность команды профессионалов говорит о возможностях</p>
            <div className='buttonRow'> {buttonsList()} </div>
            {cardList()}
        </div>
    )
}

export default App;
